import React from "react";

import ErrorView from "../AppContent/Error404/Error404";
import HomeView from "../AppContent/HomeView/HomeView";
import ShopView from "../AppContent/ShopView/ShopView";
import LoginView from "../AppContent/LoginView/LoginView";
import RegisterView from "../AppContent/RegisterView/RegisterView";

const AppContent = function (props) {
    const route = props.route;
    if(route === "home"){
        return (<HomeView />);
    }
    if(route === "shop"){
        return (<ShopView />);
    }
    if(route === "login"){
        return (<LoginView />);
    }
    if(route === "register"){
        return (<RegisterView />);
    }
    return (<ErrorView/>);
}

export default AppContent;
